INSERT INTO `tabel_ketidaksesuaian` VALUES (1,1,'Lokasi dan lingkungan IRTP tidak terawat, kotor dan berdebu','Minor'),(2,2,'Ruang produksi sempit, sukar dibersihkan, dan digunakan untuk memproduksi produk selain pangan','Minor'),(3,3,'Lantai, dinding, dan langit-langit, tidak terawat, kotor, berdebu dan atau berlendir','Minor'),(4,4,'Ventilasi, pintu, dan jendela tidak terawat, kotor, dan berdebu','Minor'),(5,5,'Permukaan yang kontak langsung dengan pangan berkarat dan kotor','Minor'),(6,6,'Peralatan tidak dipelihara, dalam keadaan kotor, dan tidak menjamin efektifnya sanitasi.','Minor'),(7,7,'Alat ukur / timbangan untuk mengukur / menimbang berat bersih / isi bersih tidak tersedia atau tidak teliti.','Serius'),(8,8,'Air bersih tidak tersedia dalam jumlah yang cukup untuk memenuhi seluruh kebutuhan produksi','Mayor'),(9,9,'Air berasal dari suplai yang tidak bersih','Kritis'),(10,10,'Sarana untuk pembersihan / pencucian bahan pangan, peralatan, perlengkapan dan bangunan tidak tersedia dan tidak terawat dengan baik','Mayor'),(11,11,'Tidak tersedia sarana cuci tangan lengkap dengan sabun dan alat pengering tangan','Serius'),(12,12,'Sarana toilet / jamban kotor tidak terawat dan terbuka ke ruang produksi','Serius'),(13,13,'Tidak tersedia tempat pembuangan sampah tertutup','Kritis'),(14,14,'Karyawan di bagian produksi pangan ada yang tidak merawat kebersihan badannya dan atau ada yang sakit','Kritis'),(15,15,'Karyawan di bagian produksi pangan tidak mengenakan pakaian kerja dan / atau mengenakan perhiasan','Serius'),(16,16,'Karyawan tidak mencuci tangan dengan bersih sewaktu memulai mengolah pangan, sesudah menangani bahan mentah, atau bahan / alat yang kotor, dan sesudah ke luar dari toilet / jamban','Kritis'),(17,17,'Karyawan bekerja dengan perilaku yang tidak baik (seperti makan dan minum) yang dapat mengakibatkan pencemaran produk pangan','Mayor'),(18,18,'Tidak ada Penanggungjawab higiene karyawan','Mayor'),(19,19,'Bahan kimia pencuci tidak ditangani dan digunakan sesuai prosedur, disimpan di dalam wadah tanpa label','Mayor'),(20,20,'Program higiene dan sanitasi tidak dilakukan secara berkala','Serius'),(21,21,'Hewan peliharaan terlihat berkeliaran di sekitar dan di dalam ruang produksi pangan.','Kritis'),(22,22,'Sampah di lingkungan dan di ruang produksi tidak segera dibuang.','Serius'),(23,23,'Bahan pangan, bahan pengemas disimpan bersama-sama dengan produk akhir dalam satu ruangan penyimpanan yang kotor, lembab dan gelap dan diletakkan di lantai atau menempel ke dinding.','Kritis'),(24,24,'Peralatan yang bersih disimpan di tempat yang kotor','Kritis'),(25,25,'IRTP tidak memiliki catatan; menggunakan bahan baku yang sudah rusak, bahan berbahaya, dan bahan tambahan pangan yang tidak sesuai dengan persyaratan penggunaannya','Kritis'),(26,26,'IRTP tidak mempunyai atau tidak mengikuti bagan alir produksi pangan','Serius'),(27,27,'IRTP tidak menggunakan bahan kemasan khusus untuk pangan','Serius'),(28,28,'BTP tidak diberi penandaan dengan benar','Serius'),(29,29,'Alat ukur / timbangan untuk mengukur / menimbang BTP tidak tersedia atau tidak teliti.','Serius'),(30,30,'Label pangan tidak mencantumkan nama produk, daftar bahan yang digunakan, berat bersih/isi bersih, nama dan alamat IRTP, masa kedaluwarsa, kode produksi dan nomor P-IRT','Kritis'),(31,31,'Label mencantumkan klaim kesehatan atau klaim gizi','Kritis'),(32,32,'IRTP tidak mempunyai penanggung jawab yang memiliki Sertifikat Penyuluhan Keamanan Pangan (PKP)','Kritis'),(33,33,'IRTP tidak melakukan pengawasan internal secara rutin, termasuk monitoring dan tindakan koreksi','Serius'),(34,34,'Pemilik IRTP tidak melakukan penarikan produk pangan yang tidak aman','Kritis'),(35,35,'IRTP tidak memiliki dokumen produksi','Serius'),(36,36,'Dokumen produksi tidak mutakhir, tidak akurat, tidak tertelusur dan tidak disimpan selama 2 (dua) kali umur simpan produk pangan yang diproduksi','Minor'),(37,37,'IRTP tidak memiliki program pelatihan keamanan pangan untuk karyawan','Kritis');
/*!40000 ALTER TABLE `tabel_ketidaksesuaian` ENABLE KEYS */;
UNLOCK TABLES;

